  - ANcpLua.Roslyn.Utilities
  namespace: ANcpLua.Roslyn.Utilities.Matching
  summary: Fluent matcher for <xref href="Microsoft.CodeAnalysis.IMethodSymbol" data-throw-if-not-resolved="false"></xref> instances.
  remarks: >-
    <p>
        Provides method-specific matching predicates in addition to the common
        symbol matching functionality from <xref href="ANcpLua.Roslyn.Utilities.Matching.SymbolMatcherBase%602" data-throw-if-not-resolved="false"></xref>.
    </p>

    <ul><li>Match by method kind (constructor, async, extension, generic).</li><li>Match by parameter count and types.</li><li>Match by return type.</li></ul>
  example: []
  syntax:
    content: 'public sealed class MethodMatcher : SymbolMatcherBase<MethodMatcher, IMethodSymbol>'
    content.vb: Public NotInheritable Class MethodMatcher Inherits SymbolMatcherBase(Of MethodMatcher, IMethodSymbol)
